    function updateCharts(selectedAttribute) {
      const barChartSpec = {
        "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
        "data": { "values": data },
        "mark": "bar",
        "encoding": {
          "x": { "field": "STREET", "type": "ordinal" },
          "y": { "field": selectedAttribute, "type": "quantitative" },
          "color": { "field": "STREET", "type": "nominal" }
        }
      };

      const scatterPlotSpec = {
        "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
        "data": { "values": data },
        "mark": "point",
        "encoding": {
          "x": { "field": "STREET", "type": "ordinal" },
          "y": { "field": selectedAttribute, "type": "quantitative" },
          "color": { "field": "STREET", "type": "nominal" }
        }
      };

      vegaEmbed('#barChart', barChartSpec);
      vegaEmbed('#scatterPlot', scatterPlotSpec);
    }

    document.getElementById('attributeSelector').addEventListener('change', function () {
      const selectedAttribute = this.value;
      updateCharts(selectedAttribute);
    });

    updateCharts('SPEED');
  </script>
